INSERT INTO `catalog_product_entity_text` VALUES (1,4,72,0,1,'**ALL ITEMS DISCOUNTED, PURCHASED ON SALE OR USING A PROMOTION CODE ARE FINAL SALE AND CANNOT BE EXCHANGED**\r\n\r\nThis suit is one of a kind! A stunning coral pink Tri top, complimented with two thin shoulder straps. Along with all seamless, pastel wash bottoms. The design of these bottoms offers a little more booty coverage, great for the shy Moana Girl! This style is great for the active girl on the go. I must have bikini to add to your collection!\r\n\r\nSets can not be broken up. This top does not come with padding, but there are inserts to add it yourself!\r\n\r\n* Supportive Tri Top\r\n* Two strap top design\r\n* Inserts for removable padding\r\n* Italian Lycra\r\n* Moderate booty coverage\r\n* Seamless\r\n* Models wears a small\r\n\r\nMade and designed by Moana Bikini for the carefree, active girl. '),(2,4,73,0,1,'**ALL ITEMS DISCOUNTED, PURCHASED ON SALE OR USING A PROMOTION CODE ARE FINAL SALE AND CANNOT BE EXCHANGED**\r\n\r\nThis suit is one of a kind! A stunning coral pink Tri top, complimented with two thin shoulder straps. Along with all seamless, pastel wash bottoms. The design of these bottoms offers a little more booty coverage, great for the shy Moana Girl! This style is great for the active girl on the go. I must have bikini to add to your collection!\r\n\r\nSets can not be broken up. This top does not come with padding, but there are inserts to add it yourself!'),(3,4,83,0,1,NULL),(4,4,106,0,1,NULL),(13,4,72,0,2,'**ALL ITEMS DISCOUNTED, PURCHASED ON SALE OR USING A PROMOTION CODE ARE FINAL SALE AND CANNOT BE EXCHANGED**\r\n\r\nFeaturing our new Miami Line-Up!\r\n\r\nAll seamless! All reversible! A must have this Summer! This style is uniquely designed for active surfer girls allowing you to have more comfort and support in the ocean. This suit is also reversible and can transform from an eye catching print, to a soft pastel pink. Mix \'N\' Match to create your own distinctive look!\r\